from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones on key conflicts.
    None values are handled gracefully by skipping them.

    Args:
        *dicts: Variable number of dictionaries to merge

    Returns:
        A new dictionary containing merged key-value pairs

    Raises:
        TypeError: If any argument is not a dictionary or None

    Example:
        merge_dicts({"a": 1}, {"b": 2}) -> {"a": 1, "b": 2}
        merge_dicts({"a": 1}, {"a": 2}) -> {"a": 2}
    """
    result: Dict[str, Any] = {}

    for d in dicts:
        if d is None:
            continue
        if not isinstance(d, dict):
            raise TypeError(f"Expected dict or None, got {type(d).__name__}")
        result.update(d)

    return result


# Test cases
if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}
    print("✓ Basic merge test passed")

    # Override test
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}
    print("✓ Override test passed")

    # None handling
    assert merge_dicts(None, {"a": 1}) == {"a": 1}
    assert merge_dicts({"a": 1}, None) == {"a": 1}
    assert merge_dicts(None, None, {"a": 1}, None) == {"a": 1}
    print("✓ None handling tests passed")

    # Empty dictionaries
    assert merge_dicts({}, {}) == {}
    assert merge_dicts({"a": 1}, {}) == {"a": 1}
    print("✓ Empty dictionary tests passed")

    # Multiple merges
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}
    print("✓ Multiple merge test passed")

    # Complex values
    assert merge_dicts({"a": [1, 2]}, {"b": {"nested": "value"}}) == {"a": [1, 2], "b": {"nested": "value"}}
    print("✓ Complex values test passed")

    # Single dictionary
    assert merge_dicts({"a": 1, "b": 2}) == {"a": 1, "b": 2}
    print("✓ Single dictionary test passed")

    # No arguments
    assert merge_dicts() == {}
    print("✓ No arguments test passed")

    # Override with None value
    assert merge_dicts({"a": 1}, {"a": None}) == {"a": None}
    print("✓ Override with None value test passed")

    # Error handling - non-dict argument
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should have raised TypeError"
    except TypeError:
        print("✓ Error handling test passed")

    # Error handling - non-dict with list
    try:
        merge_dicts([1, 2, 3])
        assert False, "Should have raised TypeError"
    except TypeError:
        print("✓ List rejection test passed")

    print("\n✓ All tests passed!")
